import React from "react";
import ReactDOM from "react-dom";

const name = "Sunil Kumar";
const city = "Haryana";
console.log(`I am from ${city} `);
const src = "https://picsum.photos/536/354";
ReactDOM.render(
  <>
   <h1 contentEditable ="true" className ="head">Hello I am </h1>
    <p>{Math.random()}</p>
    <img src = {src}/>
  </>,
  document.getElementById('root')
);
